import React from "react";

const Home = () => {
    return(
    <div>
    <Stack paddingTop='75px' textAlign='center' color={"text.main"} bgcolor={"background.default"} >
        <h1 color={"text.main"}>Welcome</h1>
        <p color={"text.main"}>This Website is a place to upload recipes, view other people's recipes, get feedback on recipes, and keep track of your fridge and pantry.</p>
    </Stack>
    </div>
    );
}

export default Home;
